import React from "react";
import {
  FaCartArrowDown,
  FaFacebook,
  FaHamburger,
  FaInstagram,
  FaTimes,
  FaWhatsapp,
} from "react-icons/fa";

import "../styles/Navbar.css";

import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <section className="navbar__main ">
      {/* logo */}
      <div className="navbar__logo">
        <p>All-Hadi</p>
        <span className="navbar__icon">
          <FaHamburger />
        </span>
      </div>
      {/* navbar for toggle  */}
      <nav className="navbar__menu">
        <div className="flex gap-2">
          <Link className="navbar__items" to="/">
            Home
          </Link>
          <Link className="navbar__items" to="/">
            Login
          </Link>
          <Link className="navbar__items" to="/">
            Sign-Up
          </Link>
        </div>
        <div className="flex gap-5 sm:gap-10">
          {/* social Icons  */}
          <div className="flex gap-5">
            <FaFacebook />
            <FaWhatsapp />
            <FaInstagram />
          </div>
          <span>
            <Link to="/cart">
              <FaCartArrowDown />
            </Link>
          </span>
        </div>
      </nav>
    </section>
  );
};

export default Navbar;
